import { Button, Label } from "src/commonStyles";
import { Container, Form, TextArea, Wrap } from "./styled";
import { Hr, Title } from "src/commonStyles";
import { Input } from "src/commonStyles";
import { SubmitHandler, useForm } from "react-hook-form";

interface IFormInput {
  category: string;
  title: string;
  description: string;
  address: string;
}

export default function AddCompany() {
  const {
    register,
    formState: { errors },
    handleSubmit,
    reset,
  } = useForm<IFormInput>();

  const onSubmit: SubmitHandler<IFormInput> = (data) => console.log(data);

  return (
    <Wrap>
      <Title>Добавить объект</Title>
      <Hr />
      <Form onSubmit={handleSubmit(onSubmit)}>
        <Container>
          <Label>Категория</Label>
          <Input $width="757px" $height="75px" />
        </Container>
        <Container>
          <Label>Название</Label>
          <Input $width="757px" $height="75px" />
        </Container>
        <Container>
          <Label>Описание</Label>
          <TextArea />
        </Container>
        <Container>
          <Label>Город</Label>
          <Input $width="757px" $height="75px" />
        </Container>
        <Container>
          <Label>Логотип</Label>
          <Button></Button>
        </Container>
      </Form>
    </Wrap>
  );
}
